import React from "react";

// События
// Условный рендеринг

const Header = ({ children }) => {
  let isLogged = true;

  let isShow = false


  return (
    <header>
      <h1>My App</h1>

      {isShow && <h1>show content</h1>}

      {isLogged === true ? (
        <ul>
          <li>Admin</li>
          <li>Users</li>
          <li>Tickets</li>
        </ul>
      ) : (
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      )}

      <h2>{children}</h2>
    </header>
  );
};

export default Header;
